import React from "react";
import JsonData from "./MOCK_DATA.json";
import Card from "./Card";

const SearchFilter = () => {
  return (
    <>
      <div>
        <input type="text" placeholder="search..." name="seachInput" />

        {JsonData.map((value, key) => {
          return (
            <Card first={value.first_name} last={value.last_name} count={key} />
          );
        })}
      </div>
    </>
  );
};

export default SearchFilter;
